// Исходное разрешение прекомпозиции
var originalWidth = 720;
var originalHeight = 1080;

// Размеры композиции, в которую вставляется прекомпозиция
var compWidth = thisComp.width;
var compHeight = thisComp.height;

// Расчет соотношений масштаба для ширины и высоты
var scaleX = compWidth / originalWidth * 100;
var scaleY = compHeight / originalHeight * 100;

// Применяем меньшее из двух соотношений, чтобы избежать искажения пропорций
var scale = Math.min(scaleX, scaleY);

[scale, scale]
